import React, {Component} from 'react';
import Path from './path';
import Gendata from './gendata/gendata';
import Mani from './mani/mani';


export default class AssetContainer extends Component {
	constructor(props){
		super(props)
		this.state = {
			data : this.props

		}
	}

	render(){
		// console.log(this)
		const {gpsid, id} = this.state.data.assetData
		return(
			<div>
				<div className='mani-container'>
					<Mani data={{'id':id, 'gps':gps}}/>
				</div>
				<div className='gendata-container'>
					<Gendata data={id}/>
				</div>
				<div className='path-container'>
					<Path data={id}/>
				</div>
			</div>
			)
	}
}
